import React from 'react'
import {
  Divider,Typography
} from "@material-ui/core";
import './style.css'
import {SideBarData} from './sideBarData'

export class index extends React.Component {
	render() {
		return (
			<div className="conte">
				<div className="sidebar">
					<Typography variant="h4" noWrap component="div" style={{color: '#c8c8c8', marginLeft: '5px',height: '55px'}} id="txt">
              WanWord
          </Typography>
					<ul className="sidebarList">
						{SideBarData.map((val,key) =>{
							return(
								<li key={key} 
								className="row"
								//id={val.link ? "active" : ""}
								onClick={()=> val.link}
								 >
									<div id="icon">
										{val.icon}
									</div>
									<div id="title">
										{val.title}
									</div>
								</li>
							)
						})}
						<Divider />
					</ul>
				</div>
			</div>
		)
	}
}

export default index
